import React, { useState, useEffect } from "react";
import axios from "axios";

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get("https://example.com/leaderboard.json").then((response) => {
      setData(response.data);
    });
  }, []);

  return (
    <div>
      <h1>LEADERBOARD</h1>
      <table>
        <thead>
          <tr>
            <th>Nickname</th>
            <th>Score</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row) => (
            <tr key={row.id}>
              <td>{row.nickname}</td>
              <td>{row.score}</td>
              <td>{row.time}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
